import productStyle from "./Product.module.css";
import data from "../../utils/data";

export default function Product() {
  const largeImg = (src) => {
    return <img src={src}></img>;
  };
  return (
    <div>
      <div className={productStyle.imgBox}>
        {data.map((obj) => {
          if (obj.id <= 4) {
            return (
              <img
                onClick={largeImg}
                className={productStyle.imgMin}
                src={obj.image}
              ></img>
            );
          }
        })}
      </div>
    </div>
  );
}
